import RegisterBG from "./image/register.jpg";
import LoginBG from "./image/login.jpg";
import Logofooter from "./image/logofooter.png";

/* Icon */
import ICFacebook from "./icon/fb.png";
import ICTwitter from "./icon/twitter.png";
import ICInstagram from "./icon/ig.png";
import ICTelegram from "./icon/telegram.png";
import ICGithub from "./icon/github.png";
/* end icon */

export {
  RegisterBG,
  LoginBG,
  Logofooter,
  ICFacebook,
  ICTwitter,
  ICInstagram,
  ICTelegram,
  ICGithub,
};
